import { Layout as AntdLayout } from "antd";
import UserDropdown from "./user-dropdown";

const HeaderContent = () => (
  <AntdLayout.Header
    className="flex justify-center shadow-sm"
    style={{ backgroundColor: "#ffffff" }}
